import React from 'react';
import { Text } from './components/Text';

export const Form = () => {
  const fields = ['text', 'radio', 'checkbox'];

  const fieldType = (key) => {
    if (key === 'text') {
      return (
        <div class='mb-3'>
          <label>Text</label>
          <input type='text' class='form-control' />
        </div>
      );
    } else if (key === 'radio') {
      <div class='mb-3'>
        <label>Radio</label>
        <input type='radio' class='form-control' name='set1' />
        <input type='radio' class='form-control' name='set1' />
      </div>;
    } else if (key === 'checkbox') {
      <div class='mb-3'>
        <label>Checkbox</label>
        <input type='checkbox' class='form-control' name='set2' />
        <input type='checkbox' class='form-control' name='set2' />
      </div>;
    }
  };

  return (
    <div>
      <Form class='row'>
        {fields.map((key, index) => {
          <React.Fragment key={index}></React.Fragment>;
        })}
      </Form>
    </div>
  );
};
